import React from "react";
import './Personal.css'

export default class Personal extends React.Component {
    render() {
        return (
            <div className={'personal'}>
                <h2>PERSONAL</h2>
                <br/>
                <span>Email address</span>
                <br/>
                <span className={'info'}>markiyan1510@gmail.com</span>
                <br/><br/>
                <span>Email address</span>
            </div>
        )
    }
}
